import allbags1 from './Frame4775.png'
import allbags2 from './Frame4785.png'
import './index.css'

const AllBags = () => {
  return (
    <div className='allbagscontainer'>
        <div>
        <img className='frameoption' src={allbags1} alt="AllFRAME" />
        <img className='frameoption' src={allbags2} alt="AllFRAME" />
        </div>
        
    </div>
  );
}

export default AllBags;
